import React, {Component} from 'react';
import {Link, withRouter} from "react-router-dom";
import './Nav.css';

class Nav extends Component{




    render(){
        return(
            <nav className={"NavbarItems"}>
                <Link to="/home" style={{ textDecoration: 'none' }}><h1 className={" navbar-logo"}>ASE THINGY</h1></Link>

                <div className={'nav-menu'}>
                    <Link to={"/studysession"}>
                        <button className={"button"}>
                            Study session
                        </button>
                    </Link>
                    <Link to="/settings">
                        <button className={"button"}>
                            Settings
                        </button>
                    </Link>
                   {/* <Link to="/measurements">
                        <button>
                            Measurements
                        </button>
                    </Link>*/}

                </div>
            </nav>
        )
    }


}

export default Nav;
